import React from "react";

function FirmCategories() {
  return (
    <div style={{ margin: "2rem", textAlign: "center" }}>
      <h2>Firm Categories</h2>
      <p>
        Show different categories (e.g., Investment Banks, Private Equity, etc.)
        to help users filter or browse specific types of firms.
      </p>
    </div>
  );
}

export default FirmCategories;
